b\u044f\u043b\u043e\u0441\u044c, \u0447\u0442\u043e \u043d\u0430\u0437\u0432\u0430\u043d\u043d\u044b\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 \u043e\u0431\u0440\u0430\u0437\u0443\u044e\u0442\u0441\u044f \u0438\u0437 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u0445 \u0441\u043b\u043e\u0431\u043e\u0434 \u0438 \u0438\u0445 \u0436\u0438\u0442\u0435\u043b\u0438 \u043f\u0435\u0440\u0435\u0432\u043e\u0434\u044f\u0442\u0441\u044f \u0432 \u0447\u0438\u0441\u043b\u043e \u0433\u043e\u0440\u043e\u0436\u0430\u043d.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1780\" class=\"mw-redirect\" title=\"1780\">1780<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B7%D0%B0_%D0%BD%D0%B5%D0%B7%D0%B0%D0%B2%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D1%8C_%D0%A1%D0%A8%D0%90\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0437\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u0421\u0428\u0410\">\u0412\u043e\u0439\u043d\u044b \u0437\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u0421\u0428\u0410<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Battle_of_Waxhaws\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0412\u044d\u043a\u0441\u0445\u043e\u0443\u0441<\/a> \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0430\u044f \u0442\u0430\u043a\u0436\u0435 \u043a\u0430\u043a \u0431\u043e\u0439\u043d\u044f \u043f\u0440\u0438 \u0412\u044d\u043a\u0441\u0445\u043e\u0443\u0441.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1790\" class=\"mw-redirect\" title=\"1790\">1790<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%B4-%D0%90%D0%B9%D0%BB%D0%B5%D0%BD%D0%B4\" title=\"\u0420\u043e\u0434-\u0410\u0439\u043b\u0435\u043d\u0434\">\u0420\u043e\u0434-\u0410\u0439\u043b\u0435\u043d\u0434<\/a> \u043f\u04